const NEWS_API = "https://newsapi.org/v2/top-headlines?country=us&apiKey=0f934fdb8888409689c62800a41196d4"


class App extends Component {
  constructor(props) {
    super(props) 

    this.state = {
      headline: []
    }
  }

  // myData =  () => {
