    //     console.error(err.message);
    //   }
    //   console.log(data.response.docs);
    // })
    this.myData()

  }

  render() {
    console.log(this.state.headline)
    return (
      <div className="App">
        <nav>
          <Link to="/">Home</Link>
          <Link to="/archives">Archives</Link>
          <Link to="/about">About</Link>
        </nav>
        <main>
          <Rout path="/searchresults" render={() => <SearchResults headline={this.state.stocks} />} />
          <SearchForm />
        </main>
      </div>
    );
  }
}

export default App;
